package com.lion.testutil.product;public enum ProductType {    P100028("P100028", "自然人风险预警查询", "com.lion.testutil.product.model.P100028"),    P100029("P100029", "失信执行人风险预警查询接口", "com.lion.testutil.product.model.P100029"),    P100044("P100044", "黑名单综合查询", "com.lion.testutil.product.model.P100044"),    P100062("P100062", "短信多重借贷数据", "com.lion.testutil.product.model.P100062");    private String prodName;    private String prodCode;    private String POJOClassName;    ProductType(String prodCode, String prodName, String POJOClassName) {        this.prodCode = prodCode;        this.prodName = prodName;        this.POJOClassName = POJOClassName;    }    public String getProdCode() {        return this.prodCode;    }    public String getProdName() {        return this.prodName;    }    public String getPOJOClassName() {        return this.POJOClassName;    }    public String toString() {        return "{\"prodName\": \"" + this.prodName + "\", " +                "\"prodCode\": \"" + this.prodCode + "\", " +                "\"POJOClassName\": \"" + this.getPOJOClassName() + "\"}";    }}